import Link from 'next/link'

export default () => (
  /* Consistent Layout used across pages */
  <Layout>
    <div>
      <h1>Magic 8 Ball</h1>
      <form className="test">
        <input type="text" ref="testingq" placeholder="Testing..."/>
      </form>
    </div>
    <style jsx>{`
      h1 {
        font-family:"Arial";
        font-size:50px;
      }`}
    </style>
  </Layout>
)

const userInput = (
  <div>
    <form className="question-input">
      <input type="text" ref="question" placeholder="Ask your question..."/>
      <input type="submit" value="Shake!"/>
    </form>
  </div>
);
